QuorumCall<AsyncLogger, Void> doPreUpgrade() {
  Map<AsyncLogger, ListenableFuture<Void>> calls =
      Maps.newHashMap();
  for (AsyncLogger logger : loggers) {
    ListenableFuture<Void> future =
        logger.doPreUpgrade();
    calls.put(logger, future);
  }
  return QuorumCall.create(calls);
}
